import{_ as e,o,c as t,O as a}from"./chunks/framework.9482e208.js";const p=JSON.parse('{"title":"§ 16.1-101 Proceedings against officer failing to make or making improper return.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/16.1-101.md","filePath":"vacode/16.1-101.md"}'),r={name:"vacode/16.1-101.md"},i=a('<h1 id="§-16-1-101-proceedings-against-officer-failing-to-make-or-making-improper-return" tabindex="-1">§ 16.1-101 Proceedings against officer failing to make or making improper return. <a class="header-anchor" href="#§-16-1-101-proceedings-against-officer-failing-to-make-or-making-improper-return" aria-label="Permalink to &quot;§ 16.1-101 Proceedings against officer failing to make or making improper return.&quot;">​</a></h1><p>If an officer fail to make due return of any execution issued from a court not of record, he may, on motion of the plaintiff and after ten days&#39; notice, be fined from time to time by the judge of such court in an amount not less than five nor more than twenty dollars for each offense. And if an officer make such return upon an execution issued from a court not of record as would, on a motion against the officer, authorize judgment to be entered against him for all or any part of the amount of such execution if the execution had issued from a court of record, the creditor on whose behalf such execution issued, or his personal representative, may, on a motion before the judge of such court after like notice obtain such judgment against the officer, his sureties and others as could be given by a court of record if the execution had issued therefrom. Section <a href="http://law.lis.virginia.gov/vacode/16.1-106/" target="_blank" rel="noreferrer">16.1-106</a> with respect to appeals in civil actions shall apply to such judgment. Notwithstanding the provisions of this section any such officer may be proceeded against as provided in Chapter 16 (§ <a href="http://law.lis.virginia.gov/vacode/15.2-1600/" target="_blank" rel="noreferrer">15.2-1600</a> et seq.) of Title 15.2, or a motion for judgment may be brought as authorized in § <a href="http://law.lis.virginia.gov/vacode/8.01-227/" target="_blank" rel="noreferrer">8.01-227</a>.</p><p>1956, c. 555.</p>',3),n=[i];function s(c,f,d,h,u,m){return o(),t("div",null,n)}const g=e(r,[["render",s]]);export{p as __pageData,g as default};
